<h2 id="Historical+Data">Historical Data</h2>

<p><a target='blank' href='http://www.quandl.com/SCF/CME_TY1_FW?utm_source=quandl&utm_medium=graph' /><img alt='Chart of CME CBOT 10-year US Treasury Note Futures (TY) Front Contract' src='http://www.quandl.com/SCF/CME_TY1_FW.png?&dataset[width]=500&dataset[height]=250&dataset[visible_columns]=3&dataset[collapse]=monthly&dataset[graph_title]=10 year us treasury note Full History'/></a></p>

<p>Quandl has historical data for the CME CBOT 10-year US Treasury Note Futures (TY) futures contract going back to 1982.</p>

<p>The highest quality source for historical CME CBOT 10-year US Treasury Note Futures (TY) futures data on Quandl is the <a href="/SCF">Stevens Continuous Futures</a> database.  This database has professional quality audited futures data including a wide variety of roll-date and price-adjustment rules.  However it is a premium database, available only to paying subscribers.  If you need to make business or investment decisions based on futures data over long horizons, you should consider this database.</p>

<p>The best free source for historical CME CBOT 10-year US Treasury Note Futures (TY) futures data on Quandl is the <a href="/CHRIS">CHRIS</a> database, compiled by one of Quandl's inhouse data curators.  This database has only one price/roll rule, and its data quality is inconsistent; but it is very wide, covering over 400 different futures contracts in addition to CL.</p>

<p>Another free alternative is to get futures data directly from the exchange: in the case of CME CBOT 10-year US Treasury Note Futures (TY) futures, this means the <a href="/CME">CME</a> database on Quandl.  Data from exchanges is not continuous; instead you will have to concatenate individual contracts by hand in order to generate long-term price histories.  Also, many exchanges do not provide backfill and so the depth of history is limited for many contracts.</p>

<h2 id="Price+Adjustments+and+Roll+Rules">Price Adjustments and Roll Rules</h2>

<p><a target='blank' href='http://www.quandl.com/SCF/CME_TY1_ON?utm_source=quandl&utm_medium=graph' /><img alt='Chart of CME CBOT 10-year US Treasury Note Futures (TY) Front Contract' src='http://www.quandl.com/SCF/CME_TY1_ON.png?&dataset[width]=500&dataset[height]=250&dataset[visible_columns]=3&dataset[collapse]=monthly&dataset[graph_title]=10 year us treasury note Open Interest Roll'/></a></p>

<p>In order to carry out long-term historical analysis of futures, it is necessary to concatenate various individual futures contracts.  Contracts can be concatenated using a variety of roll-date rules (end-of-month, last-trading-day, open-interest-switch) and price adjustments (unadjusted, panama-canal shifted, ratio-shifted, weighted-average).  <em>It is vitally important to use a roll rule and price adjustment that corresponds to your use case (trading, back-testing, technical analysis, risk management, economic forecasting) else your analysis will be compromised.</em></p>

<p>The SCF database provides a wide choice of roll and price rules for paying subscribers.  The CHRIS database provides a single roll rule (last-trading-day) and a single price rule (unadjusted).  Alternatively, you can build your own continuous contracts with your own custom roll and price rules, using the individual contract data from our exchange databases.</p>
